class detect():

    def __init__(self):
        pass

    def load_data(self, url):
        f = open(url)
        line = f.readline()
        data1 = []
        Data = []
        # data2 = {}
        while line:
            data = json.loads(line)['data']
            time = json.loads(line)['time']
            # time = datetime.datetime.fromtimestamp(float(time) / 1000).strftime('%Y-%m-%d %H:%M:%S.%f')
            data = data[1:len(data) - 1]
            for i in data.split(','):
                data1.append(float(i))
            Data.append(data1)
            # print(data1)
            # data2[time] = data1
            data1 = []
            line = f.readline()
        return Data


    def cal_sub(self, x, y):
        res = []
        for (i,j) in zip(x,y):
            sub = j-i
            if sub < 0:
                sub = 0
            res.append(10*sub)
        return res


    def set_feature(self,x, base):
        label_list = []
        if len(x) % 100 != 0:
            n = math.floor(len(x) /100) + 1
        else: n = len(x)/100
        i = 0
        while i < n:
            label_list.append(detect().cal_label(x[i * 100 :(i+1) * 100],base))
            i += 1
        return label_list


    def cal_label(self,x, base):
        label = 0
        for (i,j) in zip(x,base):
            if i > 1.5 * j:
                label = 1
        return label

    def get_feature(self):
        pass

    def set_label(self, base,url1, url2):
        pos = detect().load_data(url1)
        neg = detect().load_data(url2)
        pos_label_list = []
        neg_label_list = []
        for i in pos:
            pos_label_list = detect().set_feature(i, base)
        for j in neg:
            neg_label_list = detect().set_feature(j, base)
        return pos_label_list,neg_label_list








